import Dashboard from "./Dashboard" 
import {Navigate} from "react-router-dom"

 const ProtectedRoute = ({children,user})=>{
    console.log(user)
    if (user)return <Navigate to='/dashboard'></Navigate>;
    return children;
 }

 export default ProtectedRoute
